import React from 'react';

import {Button} from '../Button/ButtonMediumElements';
import Modal from '../Modal/Modal';
import {Section, Container,ColumnLeft, ColumnRight, NavBtn} from './InfoSectionElements';

const InfoSection = ({heading, paragraphOne, paragraphTwo, buttonLabel, reverse, image, delay}) => {
    return (
        <Section>
            <Container>
                <ColumnLeft
                    data-aos='fade-up'
                    data-aos-duration='1000'
                    data-aos-once='true'
                    data-aos-delay={delay}
                    data-aos-anchor-placement='center-bottom'
                >
                    <h1>{heading}</h1>
                    <p>{paragraphOne}</p>
                    <p>{paragraphTwo}</p>
                    <NavBtn>
                    <Button medium='true' mediumround='true'>{buttonLabel}</Button>
                    <Modal/>
                    </NavBtn>
                </ColumnLeft>
                <ColumnRight reverse={reverse}>
                    <img src={image} alt='areas'
                    data-aos='zoom-out'
                    data-aos-duration='1000'
                    data-aos-once='true'
                    data-aos-delay={delay}
                    data-aos-anchor-placement='center-bottom'/>
                </ColumnRight>
            </Container>
        </Section>
    );
};

export default InfoSection;
